// frontend/src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import './styles/global.css';  // Include global styles if you have them
import App from './App';       // Import the App component

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')  // Make sure this matches the div ID in public/index.html
);
